function Footer() {
	return (
		<footer className="footer d-none d-sm-block">
        <div className="footer-inner bgc-white-tp1">
          <div className="pt-3 border-none border-t-3 brc-grey-l2 border-double">
            <span className="text-primary-m1 font-bolder text-120">Ace</span>
            <span className="text-grey">Application Â© 2021</span>
            <span className="mx-3 action-buttons">
              <a href="#" className="text-blue-m2 text-150"><i className="fab fa-twitter-square" /></a>
              <a href="#" className="text-blue-d2 text-150"><i className="fab fa-facebook" /></a>
              <a href="#" className="text-orange-d1 text-150"><i className="fa fa-rss-square" /></a>
            </span>
          </div>
        </div>{/* .footer-inner */}
        {/* `scroll to top` button inside footer (for example when in boxed layout) */}
        <div className="footer-tools">
          <a href="#" className="btn-scroll-up btn btn-dark mb-2 mr-2 scroll-btn-visible">
            <i className="fa fa-angle-double-up mx-2px text-95" />
          </a>
        </div>
      </footer>
	);
}

export default Footer;
